const BEEP = ``;

export async function getAudioBuffer() {
	const binaryString = atob(BEEP);

	let bytes = new Uint8Array(binaryString.length);

	for (let i = 0; i < binaryString.length; i++) {
		bytes[i] = binaryString.charCodeAt(i);
	}

	const byteArray = bytes.buffer;
	const bufferView = new Uint8Array(byteArray);

	const BEEP_ARRAY_BUFFER = bufferView.buffer;

	const context = new AudioContext();
	return await context.decodeAudioData(BEEP_ARRAY_BUFFER);
}

